    "id": 4786,
    "location_id": 85,
    "attribute_id": 23,
    "value_text": "[{\"author_name\":\"Collette McDonald\",\"author_url\":\"https://www.google.com/maps/contrib/109429403165924285101/reviews\",\"language\":\"hr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjXTayX5cXeNGR8544uQHnh2D7SdcSlq00sXL594OAuGvLHKUByyJQ=s128-c0x00000000-cc-rp-mo-ba5\",\"rating\":5,\"relative_time_description\":\"prije 6 mjeseci\",\"text\":\"Imali smo fondue s juhom i OBO\u017dAVALI salatu i povr\u0107e. Meso je meso kuhano u juhi, pa nije bilo previ\u0161e uzbudljivo. Poku\u0161ao bih ne\u0161to drugo, manje turisti\u010dko. Francuski dressing je bio fantasti\u010dan! Podsjetio nas je Amerikance na pojednostavljeni ranch dressing, ali definitvno nije ranch dressing!\\n\\nObjekt je noviji od svega ostalog \u0161to smo probali na ovom putovanju. Podsje\u0107a na hotel tipa 'konvencijski' centar u Americi. Osoblje je bilo divno, a mje\u0161avina ora\u0161astih plodova u baru je ne\u0161to \u0161to svakako treba probati!\",\"time\":1736842377,\"translated\":false},{\"author_name\":\"Sabine Vuskane\",\"author_url\":\"https://www.google.com/maps/contrib/102814169623855795164/reviews\",\"language\":\"hr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjXYydQGk0R57_0xWCZHuW_6znxFMLPonu-fQIZVzs7PL2PjASaT=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"prije 2 mjeseca\",\"text\":\"Hrana je jednostavno izvrsna. Jeli smo gove\u0111u juhu s pala\u010dinkama, govedinu na vru\u0107em kamenu koju morate sami ispe\u0107i, brokule. Atmosfera je ugodna, pogledi sjajni, konobari profesionalni.\",\"time\":1747596736,\"translated\":false},{\"author_name\":\"Doroteja Miksa\",\"author_url\":\"https://www.google.com/maps/contrib/101421634062575998702/reviews\",\"language\":\"hr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjVfV-_6Eu0aX9mYQFQRVAUknR9Oc5lPxUyTFTVGvy_PFMcprqNj=s128-c0x00000000-cc-rp-mo-ba3\",\"rating\":4,\"relative_time_description\":\"prije godinu dana\",\"text\":\"Bili smo tamo dva puta, prvi put je sve pro\u0161lo dobro, hrana je bila ukusna, gula\u0161 od li\u0161aja je obavezno probati :)\\nMe\u0111utim, drugi put je bilo nekoliko razo\u010daranje - jelo od tjestenine je poslu\u017eeno gotovo hladno, ramen juha je bila izuzetno slana, te\u0161ko je bilo jesti i ne mo\u017ee se usporediti s pravim ramenom u dubini okusa. Za desert je bio izbor pakirane \u0161alice sladoleda koja, na\u017ealost, je bila stara i nije bila dobra pa smo je vratili. Usluga je izuzetno ljubazna i prijateljska, ugodna atmosfera. Op\u0107enito, neke sitnice bi mogle biti pobolj\u0161ane, ali sigurno \u0107emo ponovno do\u0107i na jo\u0161 jedan poku\u0161aj.\",\"time\":1702802723,\"translated\":false},{\"author_name\":\"Anouk Janine Braune\",\"author_url\":\"https://www.google.com/maps/contrib/111569439928920748527/reviews\",\"language\":\"hr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjWw-xqTl8DZiDEzhqHn6d8NwrbgwPd4RYWImTJJfYWYOH0QrwMl=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":4,\"relative_time_description\":\"prije godinu dana\",\"text\":\"Restoran ima vrlo ugodan interijer i imali smo sre\u0107e jesti u mirnu srijedu nave\u010der.\\n\\nNaru\u010dili smo Edamame, Cezar salatu, Schnitzel i ramen juhu.\\nSve je bilo vrlo ukusno, samo \u0161to porcija ramen juhe nije bila dovoljna za glavno jelo. A krumpir uz Schnitzel je bio malo bezukusno.\\n\\nNa\u0161 konobar je bio vrlo pa\u017eljiv i ljubazan.\\n\\nDobra ve\u010der i sjajno mjesto za ve\u010deru s ukusnom hranom!\",\"time\":1711193544,\"translated\":false},{\"author_name\":\"Mattia Sighel\",\"author_url\":\"https://www.google.com/maps/contrib/111194389316493434716/reviews\",\"language\":\"hr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjUj540lGebo7vCM4h0BlZ7CA2M6vLAexzqelaVNI_tU_6Vq-qA=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"prije godinu dana\",\"text\":\"Vrlo ugodan ru\u010dak na predivnom mjestu.\\nHrana je bila stvarno dobra i vrijedna cijene, atmosfera je bila vrlo sugestivna, osobito zahvaljuju\u0107i sjajnom pogledu kroz velike prozore na krajolik.\",\"time\":1702202414,\"translated\":false}]",
