    "value_text": "[{\"author_name\":\"Collette McDonald\",\"author_url\":\"https://www.google.com/maps/contrib/109429403165924285101/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjXTayX5cXeNGR8544uQHnh2D7SdcSlq00sXL594OAuGvLHKUByyJQ=s128-c0x00000000-cc-rp-mo-ba5\",\"rating\":5,\"relative_time_description\":\"vor 6 Monaten\",\"text\":\"Wir hatten das Br\u00fche-Fondue und LIEBTEN den Salat und das Gem\u00fcse. Fleisch ist halt Fleisch, das in Br\u00fche gekocht wird, also war es nicht besonders aufregend. Ich w\u00fcrde etwas anderes probieren und weniger touristisch. Das \u201eFrench\u201c Dressing war fantastisch! Es hat uns Amerikaner an ein einfacheres Ranch-Dressing erinnert, aber definitiv kein Ranch-Dressing!\\n\\nDie Einrichtung ist neuer als alles, was wir auf dieser Reise ausprobiert haben. Erinnerte an ein \u201eConvention\u201c Center Art Hotel in den Staaten. Das Personal war liebensw\u00fcrdig und die Nussmischung an der Bar ist ein Muss!\",\"time\":1736842377,\"translated\":true},{\"author_name\":\"Sabine Vuskane\",\"author_url\":\"https://www.google.com/maps/contrib/102814169623855795164/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjXYydQGk0R57_0xWCZHuW_6znxFMLPonu-fQIZVzs7PL2PjASaT=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"vor 2 Monaten\",\"text\":\"Das Essen ist einfach gro\u00dfartig. Wir hatten Rinderbr\u00fche mit Pfannkuchen, Rindfleisch auf hei\u00dfen Steinen, das man selbst backen muss, Brokkoli. Die Atmosph\u00e4re ist sch\u00f6n, die Aussicht gro\u00dfartig, die Kellner professionell.\",\"time\":1747596736,\"translated\":true},{\"author_name\":\"Doroteja Miksa\",\"author_url\":\"https://www.google.com/maps/contrib/101421634062575998702/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjVfV-_6Eu0aX9mYQFQRVAUknR9Oc5lPxUyTFTVGvy_PFMcprqNj=s128-c0x00000000-cc-rp-mo-ba3\",\"rating\":4,\"relative_time_description\":\"vor einem Jahr\",\"text\":\"War zweimal dort, beim ersten Mal lief alles gut, das Essen war k\u00f6stlich, der Eierschwammerl-Gulasch ist ein Muss :)\\nAllerdings gab es beim zweiten Mal ein paar Entt\u00e4uschungen - das Nudelgericht wurde fast kalt serviert, die Ramen-Suppe war extrem salzig, kaum essbar und im Geschmack nicht wirklich mit einem echten Ramen vergleichbar. Als Dessert gab es nur die Wahl zwischen einem verpackten Eisbecher, der leider alt war und nicht gut, also haben wir ihn zur\u00fcckgegeben. Der Service ist extrem nett und freundlich, angenehme Atmosph\u00e4re. Insgesamt k\u00f6nnten ein paar Kleinigkeiten verbessert werden, aber wir werden sicherlich wiederkommen, um es erneut zu versuchen.\",\"time\":1702802723,\"translated\":true},{\"author_name\":\"Anouk Janine Braune\",\"author_url\":\"https://www.google.com/maps/contrib/111569439928920748527/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjWw-xqTl8DZiDEzhqHn6d8NwrbgwPd4RYWImTJJfYWYOH0QrwMl=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":4,\"relative_time_description\":\"vor einem Jahr\",\"text\":\"Das Restaurant hat ein sehr gem\u00fctliches Innendesign und wir hatten das Gl\u00fcck, an einem ruhigen Mittwochabend zu essen.\\n\\nWir bestellten Edamame, Caesar Salat, Schnitzel und Ramen Suppe.\\nAlles war sehr lecker, nur die Portionsgr\u00f6\u00dfe der Ramen Suppe war nicht ausreichend als Hauptgericht. Und die Kartoffeln zum Schnitzel waren ein wenig geschmacklos.\\n\\nUnser Kellner war sehr aufmerksam und freundlich.\\n\\nEin guter Abend und ein gro\u00dfartiger Ort f\u00fcr ein Abendessen mit leckerem Essen!\",\"time\":1711193544,\"translated\":true},{\"author_name\":\"Mattia Sighel\",\"author_url\":\"https://www.google.com/maps/contrib/111194389316493434716/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjUj540lGebo7vCM4h0BlZ7CA2M6vLAexzqelaVNI_tU_6Vq-qA=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"vor einem Jahr\",\"text\":\"Ein sehr angenehmes Mittagessen an einem gro\u00dfartigen Ort.\\nDas Essen war wirklich gut und den Preis wert, die Atmosph\u00e4re war sehr eindrucksvoll, besonders dank des gro\u00dfartigen Blicks durch die gro\u00dfen Fenster auf die Landschaft.\",\"time\":1702202414,\"translated\":true}]",
