    "id": 4849,
    "location_id": 86,
    "attribute_id": 23,
    "value_text": "[{\"author_name\":\"javier montesquieu\",\"author_url\":\"https://www.google.com/maps/contrib/107077685752724958204/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocK2sFWZRCf-2RB-aeJpNmLpStbwAMSqr5EAm6JOzdfraOjcrg=s128-c0x00000000-cc-rp-mo-ba5\",\"rating\":1,\"relative_time_description\":\"vor 5 Monaten\",\"text\":\"Ich habe nach einem Zimmer mit Bergblick gefragt, und sie gaben mir ein dunkles Zimmer mit Blick auf ein anderes Geb\u00e4ude, etwa 3m entfernt. Die sehr junge und nicht sehr nette Dame an der Rezeption sagte mir bei der Reservierung, dass mein Zimmer auf den Parkplatz, aber auch auf die Berge blicken w\u00fcrde; nicht wahr. Sie sagte auch, dass keine weiteren Zimmer verf\u00fcgbar seien. Als ich dem Besitzer am n\u00e4chsten Morgen sagte, dass ich abreisen w\u00fcrde, sagte sie mir, dass sie mir ein anderes Zimmer geben w\u00fcrde... oh, jetzt wo ich gehe, sind Zimmer verf\u00fcgbar??\\nAuch der Speisesaal war schlecht beleuchtet, traurig, und der Service war erschreckend: kein einziges Hallo, L\u00e4cheln... der Salatbar war auf Pensionsniveau, obwohl das Fr\u00fchst\u00fcck ziemlich gut war. Der Pool hatte defekte D\u00fcsen und die T\u00fcr zum Spa war nach 19 Uhr geschlossen (aber sie \\\"wussten es nicht\\\"), obwohl sie behaupten, es sei bis viel sp\u00e4ter ge\u00f6ffnet. Dies ist kein 4-Sterne-Hotel.\\nAntwort: Ich schreibe unter einem anderen Namen, offensichtlich.\",\"time\":1739616527,\"translated\":false},{\"author_name\":\"Tom K\",\"author_url\":\"https://www.google.com/maps/contrib/102967953137811880136/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocKILrULzNRZyXx0p4D9QWdZpdy1trZxLqWsn5x0E-8vOxaw7w=s128-c0x00000000-cc-rp-mo-ba2\",\"rating\":5,\"relative_time_description\":\"vor 9 Jahren\",\"text\":\"Wir waren Ende Mai dort, was wirklich kurz vor Beginn der Hauptsaison liegt. Wir sind eigentlich recht schwer zufriedenzustellen, aber wir haben diesen Ort sehr genossen - sch\u00f6ne Zimmer, tolle Aussicht, ziemlich gute Spa-Einrichtungen, gute Lage f\u00fcr vieles und eine Station am Fu\u00dfe des H\u00fcgels, wenn man nicht fahren m\u00f6chte.\\n\\nWenn wir noch einmal hingehen w\u00fcrden, dann ein paar Wochen sp\u00e4ter, nachdem das Haupt-H\u00fctten-Netzwerk ge\u00f6ffnet ist (Mitte Juni), da die Wandersaison beginnt. Aber das Hotel selbst war gro\u00dfartig - familiengef\u00fchrt, gutes Essen, sch\u00f6ne Auswahl an haupts\u00e4chlich lokalen Weinen, sehr hilfsbereites Personal. Empfohlen.\",\"time\":1464725623,\"translated\":false},{\"author_name\":\"Andrei Chu\",\"author_url\":\"https://www.google.com/maps/contrib/102615153019744324229/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocKVWNetbs6QxuHGnBnP8H2Ewj-Wx5lRLrJvJyljqv86LTSXBw=s128-c0x00000000-cc-rp-mo-ba2\",\"rating\":5,\"relative_time_description\":\"vor 7 Jahren\",\"text\":\"Sehr freundliches, familienorientiertes Hotel. Perfekte Lage ski-in/ski-out. Die Kinder waren sehr gl\u00fccklich, einen kleinen Bauernhof zu haben, um Pferde und K\u00fche zu versorgen und zu f\u00fcttern... und nat\u00fcrlich war auch das Hallenbad ein gro\u00dfer Spa\u00df f\u00fcr sie. Sehr zu empfehlen, besonders f\u00fcr Familien mit Kindern!\",\"time\":1518013365,\"translated\":false},{\"author_name\":\"Jakub Ho\u0161ek\",\"author_url\":\"https://www.google.com/maps/contrib/104400764538449838020/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocIUWjYE23ekpCEPiz_bgkOTE9F3ttaOlJSCcBmnIL86OqPgfg=s128-c0x00000000-cc-rp-mo\",\"rating\":3,\"relative_time_description\":\"vor 12 Jahren\",\"text\":\"Ich war ziemlich entt\u00e4uscht. Das Hotel ist sch\u00f6n, aber schlecht gef\u00fchrt. Das Verhalten der Rezeption und der K\u00fcche ist nicht angemessen f\u00fcr ein 4-Sterne-Hotel und dessen Preis. Sie versuchten, uns ein Zimmer ohne Fenster zu geben, ignorierten unsere Anfragen bez\u00fcglich meiner Di\u00e4t und so weiter. Nie wieder dorthin. :-(\",\"time\":1361610854,\"translated\":false},{\"author_name\":\"Mark Vanhoorne\",\"author_url\":\"https://www.google.com/maps/contrib/112550339963850274480/reviews\",\"language\":\"de\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocLLcpbNfZ0QLVOSHMjgxXv4TndsOZsLrE3BXe8jhYLVrExx99a5=s128-c0x00000000-cc-rp-mo-ba2\",\"rating\":5,\"relative_time_description\":\"vor 3 Jahren\",\"text\":\"Sch\u00f6nes Hotel - sehr sauber und gut gepflegt - gutes Essen - freundlicher Empfang und Service - gut ausgestatteter Wellnessbereich.\",\"time\":1647965086,\"translated\":false}]",
