    "location_id": 86,
    "attribute_id": 23,
    "value_text": "[{\"nome_autore\":\"javier montesquieu\",\"url_autore\":\"https://www.google.com/maps/contrib/107077685752724958204/reviews\",\"lingua\":\"it\",\"lingua_originale\":\"en\",\"url_foto_profilo\":\"https://lh3.googleusercontent.com/a/ACg8ocK2sFWZRCf-2RB-aeJpNmLpStbwAMSqr5EAm6JOzdfraOjcrg=s128-c0x00000000-cc-rp-mo-ba5\",\"valutazione\":1,\"descrizione_tempo_relativa\":\"5 mesi fa\",\"testo\":\"Ho chiesto una stanza con vista montagna e me ne hanno data una buia che guarda un altro edificio, a circa 3 metri di distanza. La giovane e non molto gentile ragazza alla reception mi aveva detto al momento della prenotazione che la mia stanza avrebbe guardato il parcheggio ma anche le montagne; non vero. Ha anche detto che non c'erano pi\u00f9 stanze disponibili. Quando ho detto al proprietario la mattina dopo che me ne sarei andato, mi ha detto che mi avrebbe trovato un'altra stanza...ah, ora che me ne vado ci sono stanze disponibili??\\nInoltre, la sala da pranzo era poco illuminata, triste, e il servizio era pessimo: nessun saluto, sorriso...l'insalata era a livello di mensa, anche se la colazione era abbastanza buona. La piscina aveva i getti rotti e la porta della spa era chiusa dopo le 7 (ma non \\\"sapevano\\\") anche se affermano che \u00e8 aperta fino a molto pi\u00f9 tardi. Questo non \u00e8 un hotel a 4 stelle.\\nRisposta: Scrivo con un altro nome, ovviamente.\",\"tempo\":1739616527,\"tradotto\":true},{\"nome_autore\":\"Tom K\",\"url_autore\":\"https://www.google.com/maps/contrib/102967953137811880136/reviews\",\"lingua\":\"it\",\"lingua_originale\":\"en\",\"url_foto_profilo\":\"https://lh3.googleusercontent.com/a/ACg8ocKILrULzNRZyXx0p4D9QWdZpdy1trZxLqWsn5x0E-8vOxaw7w=s128-c0x00000000-cc-rp-mo-ba2\",\"valutazione\":5,\"descrizione_tempo_relativa\":\"9 anni fa\",\"testo\":\"Siamo andati a fine maggio, poco prima dell'inizio della stagione estiva principale. Siamo piuttosto difficili da accontentare, ma abbiamo apprezzato molto questo posto: belle camere, ottima vista, strutture termali abbastanza buone, buona posizione per molte attivit\u00e0 e una stazione in fondo alla collina se non vuoi guidare.\\n\\nSe ci andassimo di nuovo andremmo un paio di settimane pi\u00f9 tardi dopo che la rete principale delle baite \u00e8 aperta (met\u00e0 giugno) poich\u00e9 inizia la stagione escursionistica. Ma l'hotel stesso \u00e8 stato fantastico: gestione familiare, buon cibo, bella scelta di vini principalmente locali, personale molto disponibile. Consigliato.\",\"tempo\":1464725623,\"tradotto\":true},{\"nome_autore\":\"Andrei Chu\",\"url_autore\":\"https://www.google.com/maps/contrib/102615153019744324229/reviews\",\"lingua\":\"it\",\"lingua_originale\":\"en\",\"url_foto_profilo\":\"https://lh3.googleusercontent.com/a/ACg8ocKVWNetbs6QxuHGnBnP8H2Ewj-Wx5lRLrJvJyljqv86LTSXBw=s128-c0x00000000-cc-rp-mo-ba2\",\"valutazione\":5,\"descrizione_tempo_relativa\":\"7 anni fa\",\"testo\":\"hotel molto amichevole e orientato alla famiglia. posizione perfetta ski-in/ski-out. i bambini erano molto felici di avere una piccola fattoria, di prendersi cura e nutrire cavalli e mucche... ovviamente, la piscina coperta era anche un grande divertimento per loro. altamente raccomandato, soprattutto per le famiglie con bambini!\",\"tempo\":1518013365,\"tradotto\":true},{\"nome_autore\":\"Jakub Ho\u0161ek\",\"url_autore\":\"https://www.google.com/maps/contrib/104400764538449838020/reviews\",\"lingua\":\"it\",\"lingua_originale\":\"en\",\"url_foto_profilo\":\"https://lh3.googleusercontent.com/a/ACg8ocIUWjYE23ekpCEPiz_bgkOTE9F3ttaOlJSCcBmnIL86OqPgfg=s128-c0x00000000-cc-rp-mo\",\"valutazione\":3,\"descrizione_tempo_relativa\":\"12 anni fa\",\"testo\":\"Ero piuttosto deluso. L'hotel \u00e8 bello ma mal gestito. Il comportamento della reception e della cucina non \u00e8 adeguato a un hotel a 4 stelle e al suo prezzo. Hanno cercato di darci una stanza senza finestra, hanno ignorato le nostre richieste riguardanti la mia dieta e cos\u00ec via. Non ci torner\u00f2 mai pi\u00f9. :-(\",\"tempo\":1361610854,\"tradotto\":true},{\"nome_autore\":\"Mark Vanhoorne\",\"url_autore\":\"https://www.google.com/maps/contrib/112550339963850274480/reviews\",\"lingua\":\"it\",\"lingua_originale\":\"en\",\"url_foto_profilo\":\"https://lh3.googleusercontent.com/a/ACg8ocLLcpbNfZ0QLVOSHMjgxXv4TndsOZsLrE3BXe8jhYLVrExx99a5=s128-c0x00000000-cc-rp-mo-ba2\",\"valutazione\":5,\"descrizione_tempo_relativa\":\"3 anni fa\",\"testo\":\"Hotel bellissimo - molto pulito e ben mantenuto - buon cibo - reception e servizio amichevoli - centro benessere ben attrezzato.\",\"tempo\":1647965086,\"tradotto\":true}]",
