    "attribute_id": 23,
    "value_text": "[{\"author_name\":\"javier montesquieu\",\"author_url\":\"https://www.google.com/maps/contrib/107077685752724958204/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocK2sFWZRCf-2RB-aeJpNmLpStbwAMSqr5EAm6JOzdfraOjcrg=s128-c0x00000000-cc-rp-mo-ba5\",\"rating\":1,\"relative_time_description\":\"il y a 5 mois\",\"text\":\"J'ai demand\u00e9 une chambre avec vue sur les montagnes, et ils m'ont donn\u00e9 une chambre sombre donnant sur un autre b\u00e2timent, \u00e0 environ 3 m de distance. La tr\u00e8s jeune et peu aimable dame \u00e0 la r\u00e9ception m'a dit lorsque j'ai fait la r\u00e9servation que ma chambre donnerait sur le parking mais aussi sur les montagnes ; ce qui n'\u00e9tait pas vrai. Elle a \u00e9galement dit qu'il n'y avait plus de chambres disponibles. Quand j'ai dit au propri\u00e9taire le lendemain matin que je partirais, elle m'a dit qu'elle me donnerait une autre chambre... oh, maintenant qu'il y en a des chambres disponibles ?? \\nDe plus, la salle \u00e0 manger \u00e9tait mal \u00e9clair\u00e9e, triste, et le service \u00e9tait d\u00e9plorable : pas un seul bonjour, sourire... le bar \u00e0 salades \u00e9tait niveau pension, bien que le petit-d\u00e9jeuner \u00e9tait plut\u00f4t bon. La piscine avait les jets cass\u00e9s et la porte du spa \u00e9tait ferm\u00e9e apr\u00e8s 19 h (mais ils ne \\\"savaient pas\\\") m\u00eame s'ils affirment qu'elle est ouverte beaucoup plus tard. Ce n'est pas un h\u00f4tel 4 \u00e9toiles. \\nR\u00e9ponse : J'\u00e9cris sous un autre nom, \u00e9videmment.\",\"time\":1739616527,\"translated\":true},{\"author_name\":\"Tom K\",\"author_url\":\"https://www.google.com/maps/contrib/102967953137811880136/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocKILrULzNRZyXx0p4D9QWdZpdy1trZxLqWsn5x0E-8vOxaw7w=s128-c0x00000000-cc-rp-mo-ba2\",\"rating\":5,\"relative_time_description\":\"il y a 9 ans\",\"text\":\"Nous y sommes all\u00e9s fin mai, ce qui est vraiment juste avant le d\u00e9but de la saison estivale principale. Nous sommes en fait assez difficiles \u00e0 satisfaire, mais nous avons vraiment appr\u00e9ci\u00e9 cet endroit - belles chambres, belle vue, installations spa assez bonnes, bon emplacement pour beaucoup de choses et une gare en bas de la colline si vous n'avez pas envie de conduire.\\n\\nSi nous y retournions, nous irions quelques semaines plus tard, apr\u00e8s l'ouverture du r\u00e9seau principal de refuges (mi-juin) lorsque la saison de randonn\u00e9e commence. Mais l'h\u00f4tel lui-m\u00eame \u00e9tait super - tenu par une famille, bonne nourriture, bon choix de vins principalement locaux, personnel tr\u00e8s serviable. Recommand\u00e9.\",\"time\":1464725623,\"translated\":true},{\"author_name\":\"Andrei Chu\",\"author_url\":\"https://www.google.com/maps/contrib/102615153019744324229/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocKVWNetbs6QxuHGnBnP8H2Ewj-Wx5lRLrJvJyljqv86LTSXBw=s128-c0x00000000-cc-rp-mo-ba2\",\"rating\":5,\"relative_time_description\":\"il y a 7 ans\",\"text\":\"h\u00f4tel tr\u00e8s convivial, orient\u00e9 famille. emplacement parfait ski-in/ski-out. les enfants \u00e9taient tr\u00e8s heureux d'avoir une petite ferme, de s'occuper et de nourrir les chevaux et les vaches... bien s\u00fbr, la piscine int\u00e9rieure \u00e9tait aussi tr\u00e8s amusante pour eux. hautement recommand\u00e9, surtout pour les familles avec enfants !\",\"time\":1518013365,\"translated\":true},{\"author_name\":\"Jakub Ho\u0161ek\",\"author_url\":\"https://www.google.com/maps/contrib/104400764538449838020/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocIUWjYE23ekpCEPiz_bgkOTE9F3ttaOlJSCcBmnIL86OqPgfg=s128-c0x00000000-cc-rp-mo\",\"rating\":3,\"relative_time_description\":\"il y a 12 ans\",\"text\":\"J'ai \u00e9t\u00e9 assez d\u00e9\u00e7u. L'h\u00f4tel est magnifique mais mal g\u00e9r\u00e9. Le comportement \u00e0 la r\u00e9ception et en cuisine n'est pas ad\u00e9quat pour un h\u00f4tel 4 \u00e9toiles et son prix. Ils ont essay\u00e9 de nous donner une chambre sans fen\u00eatre, ignor\u00e9 nos demandes concernant mon r\u00e9gime alimentaire, etc. Je n'y retournerai jamais. :-(\",\"time\":1361610854,\"translated\":true},{\"author_name\":\"Mark Vanhoorne\",\"author_url\":\"https://www.google.com/maps/contrib/112550339963850274480/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocLLcpbNfZ0QLVOSHMjgxXv4TndsOZsLrE3BXe8jhYLVrExx99a5=s128-c0x00000000-cc-rp-mo-ba2\",\"rating\":5,\"relative_time_description\":\"il y a 3 ans\",\"text\":\"Bel h\u00f4tel - tr\u00e8s propre et bien entretenu - bonne nourriture - r\u00e9ception et service amicaux - espace bien-\u00eatre bien \u00e9quip\u00e9.\",\"time\":1647965086,\"translated\":true}]",
