    "value_text": "[{\"author_name\":\"M. R.\",\"author_url\":\"https://www.google.com/maps/contrib/107335019455068513150/reviews\",\"language\":\"it\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjXEFen5YTambLlI1nBDDNPXgf5mBlOqzWtbL5QKwiXS6P4XSkpE=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":5,\"relative_time_description\":\"5 anni fa\",\"text\":\"Personalmente per me \u00e8 il pi\u00f9 bel piccolo villaggio sul mare in Istria! Perch\u00e9 mi piace cos\u00ec tanto? Si parcheggia l'auto e poi \u00e8 tutto a distanza di passeggiata, dalla spiaggia ai ristoranti, caffetterie, panetterie.. banche.. spiagge.. tutto!\",\"time\":1564932985,\"translated\":true},{\"author_name\":\"Branislav Kli\u010dinovi\u0107\",\"author_url\":\"https://www.google.com/maps/contrib/118299294480553454103/reviews\",\"language\":\"it\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjVvM9vivHXTIVh-zCuIk7yj7vDtaxa50HSROZI98G0vp_aocTuySA=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":5,\"relative_time_description\":\"5 anni fa\",\"text\":\"Piccola citt\u00e0 di pescatori con cittadini molto gentili\",\"time\":1565394245,\"translated\":true},{\"author_name\":\"Jonas Jonsson\",\"author_url\":\"https://www.google.com/maps/contrib/107750175266432893221/reviews\",\"language\":\"it\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjU8mWGER4IcqFTxNfsodLw6cnK0jEG888MwWlE0SWzM5fsHv3vmpw=s128-c0x00000000-cc-rp-mo-ba7\",\"rating\":4,\"relative_time_description\":\"3 anni fa\",\"text\":\"Un piccolo ma efficiente negozio con le cose necessarie. Il cassiere sempre molto gentile.\",\"time\":1656145787,\"translated\":true},{\"author_name\":\"Sandra Sversepa\",\"author_url\":\"https://www.google.com/maps/contrib/108045412715538082585/reviews\",\"language\":\"it\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjWVtcSJMMGnINy9vsPpNN5_bp5R2-0NvkU3odxE3VMOvx1LSfxJ=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":5,\"relative_time_description\":\"un mese fa\",\"text\":\"Adoro questo posto\",\"time\":1750005680,\"translated\":true},{\"author_name\":\"Micha\u0142 Sz\",\"author_url\":\"https://www.google.com/maps/contrib/103252486311649769608/reviews\",\"language\":\"it\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocLhrhiBRryoNuvWmNip9dMCeuirQvqLygGG83CVoKgdxkm4G4WR=s128-c0x00000000-cc-rp-mo-ba3\",\"rating\":4,\"relative_time_description\":\"4 anni fa\",\"text\":\"Negozio piccolo con prodotti alimentari/non alimentari di base, ma secondo me non serve altro da un negozio del genere.\",\"time\":1626624436,\"translated\":true}]",
