    "attribute_id": 23,
    "value_text": "[{\"author_name\":\"Eva Steindl\",\"author_url\":\"https://www.google.com/maps/contrib/109856232777498607228/reviews\",\"language\":\"en\",\"original_language\":\"de\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjUoqiC6g0xKbaaPwP8Cm4-IBTglR8LL9Ee1dL7Yxr0BUByOH7cw=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"vor 4 Monaten\",\"text\":\"Vielen Dank f\u00fcr die kompetente Beratung durch Frau T. in St. Johann/Pongau. Ich war v\u00f6llig verzweifelt, weil ich nichts mehr sehen konnte. Glaukom, besch\u00e4digter Sehnerv... Frau T. hat mir eine passende Brille mit sch\u00f6nen Fassungen gemacht. Seit ich die Brille habe, kann ich wieder alles sehen. Man kann sich nicht vorstellen, wie es ist, wenn man kaum noch etwas sieht. Und dann setzt man pl\u00f6tzlich eine Brille auf und sieht alles wieder klar. Eine neue Lebensqualit\u00e4t. Vielen Dank daf\u00fcr, Frau T. Ich w\u00fcrde es nur empfehlen. \ud83d\udc4d\ud83d\udc4d\ud83d\udc4d\ud83e\udd13\ud83d\ude03\ud83d\ude03\",\"time\":1742126273,\"translated\":true},{\"author_name\":\"Gerold Grindel\",\"author_url\":\"https://www.google.com/maps/contrib/117570472777111501642/reviews\",\"language\":\"en\",\"original_language\":\"de\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocK_ZLw6D9eKm4SIxl2qUvwbn-XrLCh1s8uEgd8eMTRAxC7Vow=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":5,\"relative_time_description\":\"vor 3 Monaten\",\"text\":\"Ich habe k\u00fcrzlich Brillen Wutscher besucht und war von der freundlichen und professionellen Atmosph\u00e4re beeindruckt. Von der ersten bis zur letzten Minute habe ich mich willkommen und gut beraten gef\u00fchlt. Die Qualit\u00e4t des Services war ausgezeichnet. Insbesondere der nachtr\u00e4gliche Austausch des Brillenmodells wurde problemlos und in sehr kurzer Zeit durchgef\u00fchrt. Insgesamt kann ich Brillen Wutscher uneingeschr\u00e4nkt empfehlen. Die freundliche und kompetente Beratung sowie die angenehme Atmosph\u00e4re machten meinen Besuch zu einem positiven Erlebnis.\",\"time\":1743332817,\"translated\":true},{\"author_name\":\"Anton Rudolf Mayer\",\"author_url\":\"https://www.google.com/maps/contrib/104941061089240519268/reviews\",\"language\":\"en\",\"original_language\":\"de\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjV1YPrMt1qsAau-gf610c6DK7d35DcivwqRwsJNFPqnCV4wWyN9eQ=s128-c0x00000000-cc-rp-mo-ba3\",\"rating\":5,\"relative_time_description\":\"vor einem Monat\",\"text\":\"Die Brille ist im Urlaub kaputt gegangen. Der Mitarbeiter war fantastisch. Sie haben mir sofort Ersatz besorgt, und die Spezialgl\u00e4ser wurden angepasst. Sehr empfehlenswert.\",\"time\":1750154034,\"translated\":true},{\"author_name\":\"Manfred Golser\",\"author_url\":\"https://www.google.com/maps/contrib/114398464943422291712/reviews\",\"language\":\"de\",\"original_language\":\"de\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocLMZ8pHIEcdBB228sHAV17l0ha8d6NA7BQN3-o2OGawBhlcNg=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"vor 3 Monaten\",\"text\":\"Die Bedienung u.Beratung top Freundliche Atmosph\u00e4re nicht aufdringlich man nimmt sich gen\u00fcgend Zeit f\u00fcr alle Fragen. Wir k\u00f6nnen diese Filiale von Sehen!Wutscher nur weiterempfehlen und kommen gerne wieder Silvana&Manfred\",\"time\":1743076906,\"translated\":false},{\"author_name\":\"Paul Sch\u00e4fer\",\"author_url\":\"https://www.google.com/maps/contrib/106674666225853364481/reviews\",\"language\":\"en\",\"original_language\":\"de\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjXjn4VR5bvfWl_Tq7B4wEh_dBTaApfSoMNTYrfj1FF-vJewlNU=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"vor 11 Monaten\",\"text\":\"Vom freundlichen Empfang \u00fcber die kompetente Beratung bis hin zum Produkt selbst, alles ist einfach perfekt! Ich f\u00fchle mich hier sehr wohl, besonders bei der Filialleiterin. Im Durchschnitt kommen die Brillen immer zwei Tage vor dem erwarteten Ankunftsdatum an :) Ich kann besonders die Hausmarke FR!TZ empfehlen.\",\"time\":1724075498,\"translated\":true}]",
