    "value_text": "[{\"author_name\":\"Tibi N\",\"author_url\":\"https://www.google.com/maps/contrib/104641784180490772443/reviews\",\"language\":\"en\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocIRCZFJKXAzqP-EFvGmBuYKhFkfH0MvRqGAPiDy00O1JBmwGA=s128-c0x00000000-cc-rp-mo-ba6\",\"rating\":4,\"relative_time_description\":\"2 years ago\",\"text\":\"If you are a boat fan this is the place for you, as you can see all type of boats,  from small ones to luxury yachts. The marina also connects the Rovinj beach area and the old town , and there is a very nice pedestrian area from were you can admire the old city hill ,the sea and the boats.\",\"time\":1662636919,\"translated\":false},{\"author_name\":\"A. Dream\",\"author_url\":\"https://www.google.com/maps/contrib/104416518916868238714/reviews\",\"language\":\"en\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjWcVZKWHyK7fEx2IsnLQ0KUu3IKdtzcrBGZqBHRPy7HJUTzCELQ=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":3,\"relative_time_description\":\"4 years ago\",\"text\":\"Great place with the beautiful view.\\nSo 3 stars for the location.\\nBut in my opinion it\u2019s quite expensive for Croatian standard, especially with no other services like sailor\u2019s shop or a typical seafood \ud83e\udd9e tavernas.\\nI hope that it will change in future.\",\"time\":1597253740,\"translated\":false},{\"author_name\":\"Philipp K.\",\"author_url\":\"https://www.google.com/maps/contrib/118071363028394439906/reviews\",\"language\":\"en\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocJFxO8uPHPFGtHBeDnUEZzaME9h3pIcTPDPgJj3SwPvHJ0Ckw=s128-c0x00000000-cc-rp-mo-ba6\",\"rating\":5,\"relative_time_description\":\"4 years ago\",\"text\":\"Splendid view over Rovinj harbour, walk around the Hotels at the shore. \\\"Park\\\" your ship and enter the city.\",\"time\":1617732957,\"translated\":false},{\"author_name\":\"Kiki Zd\",\"author_url\":\"https://www.google.com/maps/contrib/113425725451610275134/reviews\",\"language\":\"en\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjU-IzmKrPRrWSu4tKkE-dXhtY7P_4gp-kBq8rFnQDAw5hG383FZ=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"a year ago\",\"text\":\"A month ago, my partner had an accident on boat and was taken to the hospital in Pula for surgery, where he spent two days. Our boat was in ACI Marina Rovinj that time and we were moved by the care and support of the people - from the marina staff, to the receptionist and the manager. They made sure the boat was safe, asked regularly on my partner's health status, and didn't charge us the berth.\",\"time\":1721732479,\"translated\":false},{\"author_name\":\"Radoslav Dejanovi\u0107\",\"author_url\":\"https://www.google.com/maps/contrib/109917831481239113296/reviews\",\"language\":\"en\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjXM2Jm_hQ5as4QyGkAiagaJCpqatcgdyEFnWI83NPaPjngdpX3Onw=s128-c0x00000000-cc-rp-mo-ba6\",\"rating\":5,\"relative_time_description\":\"4 years ago\",\"text\":\"New, shiny and just a short walk away from the old town.\",\"time\":1606589378,\"translated\":false}]",
