    "id": 19444,
    "location_id": 527,
    "attribute_id": 23,
    "value_text": "[{\"author_name\":\"Tibi N\",\"author_url\":\"https://www.google.com/maps/contrib/104641784180490772443/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocIRCZFJKXAzqP-EFvGmBuYKhFkfH0MvRqGAPiDy00O1JBmwGA=s128-c0x00000000-cc-rp-mo-ba6\",\"rating\":4,\"relative_time_description\":\"il y a 2 ans\",\"text\":\"Si vous \u00eates un fan de bateaux, cet endroit est fait pour vous, car vous pouvez voir tous types de bateaux, des petits aux yachts de luxe. La marina relie \u00e9galement la plage de Rovinj et la vieille ville, et il y a une tr\u00e8s belle zone pi\u00e9tonne d'o\u00f9 vous pouvez admirer la colline de la vieille ville, la mer et les bateaux.\",\"time\":1662636919,\"translated\":true},{\"author_name\":\"A. Dream\",\"author_url\":\"https://www.google.com/maps/contrib/104416518916868238714/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjWcVZKWHyK7fEx2IsnLQ0KUu3IKdtzcrBGZqBHRPy7HJUTzCELQ=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":3,\"relative_time_description\":\"il y a 4 ans\",\"text\":\"Bel endroit avec une vue magnifique. Donc, 3 \u00e9toiles pour l'emplacement. Mais \u00e0 mon avis, c'est assez cher pour un standard croate, surtout sans autres services comme une boutique de marin ou des tavernes typiques de fruits de mer \ud83e\udd9e. J'esp\u00e8re que cela changera \u00e0 l'avenir.\",\"time\":1597253740,\"translated\":true},{\"author_name\":\"Philipp K.\",\"author_url\":\"https://www.google.com/maps/contrib/118071363028394439906/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a/ACg8ocJFxO8uPHPFGtHBeDnUEZzaME9h3pIcTPDPgJj3SwPvHJ0Ckw=s128-c0x00000000-cc-rp-mo-ba6\",\"rating\":5,\"relative_time_description\":\"il y a 4 ans\",\"text\":\"Vue splendide sur le port de Rovinj, promenez-vous autour des h\u00f4tels au bord de l'eau. \\\"Garez\\\" votre navire et entrez dans la ville.\",\"time\":1617732957,\"translated\":true},{\"author_name\":\"Kiki Zd\",\"author_url\":\"https://www.google.com/maps/contrib/113425725451610275134/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjU-IzmKrPRrWSu4tKkE-dXhtY7P_4gp-kBq8rFnQDAw5hG383FZ=s128-c0x00000000-cc-rp-mo\",\"rating\":5,\"relative_time_description\":\"il y a un an\",\"text\":\"Il y a un mois, mon partenaire a eu un accident sur un bateau et a \u00e9t\u00e9 transport\u00e9 \u00e0 l'h\u00f4pital de Pula pour une intervention chirurgicale, o\u00f9 il a pass\u00e9 deux jours. Notre bateau \u00e9tait \u00e0 ACI Marina Rovinj \u00e0 ce moment-l\u00e0 et nous avons \u00e9t\u00e9 touch\u00e9s par les soins et le soutien des gens - de l'\u00e9quipe de la marina, \u00e0 la r\u00e9ceptionniste et au manager. Ils se sont assur\u00e9s que le bateau \u00e9tait en s\u00e9curit\u00e9, ont demand\u00e9 r\u00e9guli\u00e8rement le statut de sant\u00e9 de mon partenaire et ne nous ont pas factur\u00e9 le mouillage.\",\"time\":1721732479,\"translated\":true},{\"author_name\":\"Radoslav Dejanovi\u0107\",\"author_url\":\"https://www.google.com/maps/contrib/109917831481239113296/reviews\",\"language\":\"fr\",\"original_language\":\"en\",\"profile_photo_url\":\"https://lh3.googleusercontent.com/a-/ALV-UjXM2Jm_hQ5as4QyGkAiagaJCpqatcgdyEFnWI83NPaPjngdpX3Onw=s128-c0x00000000-cc-rp-mo-ba6\",\"rating\":5,\"relative_time_description\":\"il y a 4 ans\",\"text\":\"Nouvelle, brillante et \u00e0 seulement quelques pas de la vieille ville.\",\"time\":1606589378,\"translated\":true}]",
